import React, { Component } from 'react';
const Banner = () => {
    return ( 
        <React.Fragment>
            <header class="banner">
                <div class="container-fluid">
                    <div class="row">
                        <div class="col-lg-8 col-md-8">
                            <div class="main-banner-content">
                                <h1>Lettuce</h1>
                                <p>Whatever You Need You Will Find It Here</p>

                            </div>
                        </div>
                    </div>
                </div>
            </header>
            </React.Fragment>
     );
}
 
export default Banner;
